le:"🧭 Before You Decide If This Is For You",commonQuestionsTitle:"Most people who get here wonder about one of these things:",myth1:`"What if I don't have a camera, equipment, or expensive laptop?"`,truth1:"👉 You don't need expensive equipment. Start with what you have – and upgrade over time. What matters is knowing how to use the idea, not what camera you hold.",myth2:`"I've never edited before. Will I be able to?"`,truth2:"👉 It's created for people with no experience. We'll work with clear steps, real examples, and an approach that doesn't throw you in the deep end. You'll get into rhythm much faster than you expect.",myth3:`"I don't have time."`,truth3:"👉 You don't need to spend all day in front of the screen. You have access to systems and templates that save you time. Work with focus, not hours.",myth4:`"What if it doesn't work?"`,truth4:"👉 The only way something works is by testing it. This isn't for people who wait for motivation. It's for people who want a skill that opens opportunities – and are ready to start.",myth5:"📌 This isn't for everyone.",truth5:"👉 The only way something works is by testing it. But if you're among the few who want to learn to earn with skills, not clichés – you'll feel right at home.",resourcesTitle:"🎁 Resources You Get",mainResourceTitle:"Hook & Story Formula",mainResourceDescription:"Ready scripts and formulas for creating video content that engages and sells.",resource1Emoji:"📊",resource1Title:"Professional Offer",resource1Description:"Ready templates for offers that show value and attract clients.",resource2Emoji:"🎨",resource2Title:"Portfolio Templates",resource2Description:"Professional templates for presenting your work.",resource3Emoji:"💬",resource3Title:"Communication Scripts",resource3Description:"Ready templates for client communication and presentations.",resource4Emoji:"🎥",resource4Title:"Video Presentations",resource4Description:"Structure and scripts for creating video presentations.",resource5Emoji:"📈",resource5Title